import { useSpring, animated } from "react-spring";

const FadeIn = (WrappedComponent) => ({ ...rest }) => {
  const Spring = useSpring({
    opacity: 1,
    from: { opacity: 0 },
  });
  return (
    <animated.div style={Spring}>
      <WrappedComponent> test</WrappedComponent>
    </animated.div>
  );
};

export default FadeIn;
